// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

import { IERC20Metadata } from "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import "./IOracle.sol";

contract Oracle is IOracle {

    address private immutable _underlying;

    function name() external view returns (string memory) {
        // string memory _name = "Vault";
        return IERC20Metadata(_underlying).name();
    }

    function precision() external pure returns (uint256) {
        return 100;
    }

    constructor(address underlying) {
        _underlying = underlying;
    }

    function getRate(uint256 amount) external pure returns (uint256) {
        return amount * 1 * 100;
    }
}

contracts/Token.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

import {ERC20} from "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import {IERC1363} from "./ERC1363/IERC1363.sol";
import {IERC1363Receiver} from "./ERC1363/IERC1363Receiver.sol";

contract Token is ERC20, IERC1363 {
    constructor() ERC20("Block52", "B52") {
        _mint(msg.sender, 100_000_000 * 10 ** decimals());
    }

    function approveAndCall(
        address spender,
        uint256 amount,
        bytes calldata extraData
    ) external returns (bool) {
        // Approve the spender to spend the tokens
        _approve(msg.sender, spender, amount);

        // Call the receiveApproval function on the spender contract
        IERC1363Receiver(spender).receiveApproval(
            msg.sender,
            amount,
            address(this),
            extraData
        );

        return true;
    }
}

contracts/Vault.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

import {ECDSA} from "@openzeppelin/contracts/utils/cryptography/ECDSA.sol";
import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {IERC20Metadata} from "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import {IERC1363Receiver} from "./ERC1363/IERC1363Receiver.sol";
import {IValidator} from "./IValidator.sol";

contract Vault is IValidator, IERC1363Receiver {
    using ECDSA for bytes32;

    mapping(address => uint256) public balances;
    mapping(address => uint256) public lockTimes;

    address public immutable underlying;
    uint256 public immutable lockTime;
    uint256 public minValidatorStake;

    function name() external view returns (string memory) {
        // string memory _name = "Vault";
        return IERC20Metadata(underlying).name();
    }

    function isValidator(address account) external view returns (bool) {
        return _isValidator(account);
    }

    function _isValidator(address account) private view returns (bool) {
        if (account == address(0)) {
            return false;
        }

        return balances[account] > minValidatorStake;
    }

    constructor(
        address _underlying,
        uint256 _lockTime,
        uint256 _minValidatorStake
    ) {
        underlying = _underlying;
        lockTime = _lockTime;
        minValidatorStake = _minValidatorStake;
    }

    function stake(uint256 amount) external {
        IERC20 token = IERC20(underlying);
        token.transferFrom(msg.sender, address(this), amount);

        lockTimes[msg.sender] = block.timestamp + lockTime;
        balances[msg.sender] += amount;

        emit Staked(msg.sender, amount);
    }

    function withdraw(uint256 amount) external {
        require(balances[msg.sender] >= amount, "Vault: insufficient balance");
        require(
            block.timestamp >= lockTimes[msg.sender],
            "Vault: funds are locked"
        );

        balances[msg.sender] -= amount;

        IERC20 token = IERC20(underlying);
        token.transfer(msg.sender, amount);

        emit Withdrawn(msg.sender, amount);
    }

    /// @notice Wewe token approveAndCall
    function receiveApproval(
        address from,
        uint256 amount,
        address token,
        bytes calldata extraData
    ) external {

    }

    function slash(address account, bytes32 proof) external {
        // address signer = ECDSA.recover(account, proof);
        // require(_isValidator(signer), "Bridge: invalid signature");

        // uint256 amount = balances[account];
        balances[account] = 0;
    }

    event Staked(address indexed user, uint amount);
    event Withdrawn(address indexed user, uint amount);
}

